	#compress and encode#
	if(COMPRESS_GLOBAL){
		function compress($buffer){
			$search = array(
				'/\n/',
				'/\>[^\S ]+/s',
				'/[^\S ]+\</s',
				'/(\s)+/s'
			);
			$replace = array(
				' ',
				'>',
				'<',
				'\\1'
			);
			$buffer = preg_replace($search, $replace, $buffer);
			$buffer = preg_replace('/\&nbsp;/',' ',$buffer);
			return $buffer;
		}
		ob_start("compress");
	}else{
		function compress($buffer){
			$buffer = preg_replace('/\&nbsp;/',' ',$buffer);
			return $buffer;
		}
		ob_start("compress");
	}
